packingSlip.onChange:
const allShippingLines = $getGrid('shipmentLines')
// console.log('all purchaseLines: ', allPurchaseOrderLines)
const filteredLines = allShippingLines.filter(
  (line) => line.packingSlip === rowData.packingSlip
)
// console.log('filtered: ', filteredLines)
const packingSlipName = rowData.$packingSlip$display
// console.log('purchase order name: ', purchaseOrderName)
if (packingSlipName !== null) {

  const newId = `${packingSlipName}-${filteredLines.length}`

  $dgSetRowVals('shipmentLines', rowData.rowKey, {
    name: newId,
  })
}

remainingQuantity.onChange:
if(rowData.remainingQuantity == 0) {
    $dgSetRowVals('shipmentLines', rowData.rowKey, {
    shipped: true
})
}
const getShipmentLines = $getGrid('shipmentLines').filter((f) => f.remainingQuantity > 0 && f.packingSlip === rowData.packingSlip)

if(getShipmentLines.length > 0) {
$dgSetRowVals('shipping', rowData.packingSlip, {
    status: "-OQmpz6_mCIhbFwVGyhB"
})
} else {
$dgSetRowVals('shipping', rowData.packingSlip, {
    status: "-OQmq0g7ezPPn3ZC8Zft"
})   
}

shippedQuantity.onChange:
if (rowData.shippedQuantity >= rowData.quantitytoShip) {
  // Update the record to set shipped to true
  $dgSetRowVals('shipmentLines', rowData.rowKey, {
    shipped: true
  });
  console.log('Record updated successfully');
} else {
  console.log('Condition not met, no update performed');
}

onRecordCreate:
if(!rowData.name) {

setTimeout(() => {
    console.log('data in here: ', rowData);
    const shipmentLinesFiltered = $getGrid('shipmentLines').filter((line) => line.packingSlip === rowData.packingSlip);

    const parentId = rowData.$salesOrder$display;
    const lineIndex = salesLinesFiltered.length + 1; // Incrementing to get the next index
    const newId = `${parentId}-${String(lineIndex).padStart(2, '0')}`; // Formatted ID

    $dgSetRowVals('shipmentLines', rowData.rowKey, {
        name: newId
    });
}, 1000);
}
